begin
wwv_flow_imp_shared.create_plugin(
 p_id=>wwv_flow_imp.id(191847887586855862)
,p_plugin_type=>'DYNAMIC ACTION'
,p_name=>'RM-COMPONENT-CAPTURE'
,p_display_name=>'RittmanMead Component Capture'
,p_category=>'EXECUTE'
,p_supported_ui_types=>'DESKTOP'
,p_javascript_file_urls=>wwv_flow_string.join(wwv_flow_t_varchar2(
'#PLUGIN_FILES#js/rmComponentCapture#MIN#.js',
'#PLUGIN_FILES#js/html2canvas#MIN#.js'))
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'function render ',
'  ( p_dynamic_action in apex_plugin.t_dynamic_action',
'  , p_plugin         in apex_plugin.t_plugin )',
'return apex_plugin.t_dynamic_action_render_result',
'as',
'',
'    l_result     apex_plugin.t_dynamic_action_render_result;',
'    ',
'    -- custom attributes',
'',
'    -- class or ID of the component to capture',
'    l_jquery_selector p_dynamic_action.attribute_01%type := p_dynamic_action.attribute_01;',
'    -- type of the plugin: "Save" to save to collection, "Download" to save file locally',
'    l_type            p_dynamic_action.attribute_02%type := p_dynamic_action.attribute_02;',
'    -- name of the collection to save the image',
'    l_collection_name p_dynamic_action.attribute_03%type := p_dynamic_action.attribute_03;',
'    -- selector type, jQuery or Item containg element selector.',
'    l_selector_type   p_dynamic_action.attribute_05%type := p_dynamic_action.attribute_05;',
'    -- selector type, jQuery or Item containg element selector.',
'    l_item_selector   p_dynamic_action.attribute_06%type := p_dynamic_action.attribute_06;',
'',
'begin',
'    ',
'    --debug',
'    if apex_application.g_debug ',
'    then',
'        apex_plugin_util.debug_dynamic_action',
'          ( p_plugin         => p_plugin',
'          , p_dynamic_action => p_dynamic_action',
'          );',
'    end if;',
'',
'    l_result.javascript_function := ''RM.componentCapture'';',
'    l_result.ajax_identifier     := apex_plugin.get_ajax_identifier;',
'    l_result.attribute_01        := l_jquery_selector;',
'    l_result.attribute_02        := l_type;',
'    l_result.attribute_03        := l_collection_name;',
'    l_result.attribute_05        := l_selector_type;',
'    l_result.attribute_06        := l_item_selector;',
'    ',
'    return l_result;',
'    ',
'end render;',
'',
'function ajax',
'  ( p_dynamic_action in apex_plugin.t_dynamic_action',
'  , p_plugin         in apex_plugin.t_plugin',
'  )',
'return apex_plugin.t_dynamic_action_ajax_result',
'as',
'    l_result apex_plugin.t_dynamic_action_ajax_result;',
'    l_collection_name  p_dynamic_action.attribute_03%type := p_dynamic_action.attribute_03;',
'',
'  --',
'    l_blob            blob;',
'    l_filename        varchar2(100);',
'    l_mime_type       varchar2(100);',
'    l_token           varchar2(32000);',
'  --',
'begin',
'  -- set the mime type',
'  l_mime_type := (''image/png'');',
'  -- set the filename',
'  l_filename  := ''capture_'' || to_char(sysdate, ''YYYYMMDDHH24MISS'');',
'',
'  -- build clob from f01 30k array',
'  dbms_lob.createtemporary(l_blob,',
'                           false,',
'                           dbms_lob.session);',
'  for i in 1 .. apex_application.g_f01.count loop',
'    l_token := wwv_flow.g_f01(i); --apex_application.g_f01(i);',
'    if length(l_token) > 0 then',
'      dbms_lob.append(l_blob,',
'                      to_blob(utl_encode.base64_decode(utl_raw.cast_to_raw(l_token))));',
'    end if;',
'  end loop;',
'  --',
'  -- create collection with collection name that user provides',
'  ',
'  if not apex_collection.collection_exists(p_collection_name => l_collection_name) then',
'    apex_collection.create_collection(l_collection_name);',
'  end if;',
'  -- add collection member (only if blob not null)',
'  if dbms_lob.getlength(lob_loc => l_blob) is not null then',
'    apex_collection.add_member(p_collection_name => l_collection_name,',
'                               p_c001            => l_filename, -- filename',
'                               p_c002            => l_mime_type, -- mime_type',
'                               p_d001            => sysdate, -- date created',
'                               p_blob001         => l_blob); -- blob img content',
'  end if;',
'  --',
'',
'    return l_result;',
'    ',
'end ajax;'))
,p_api_version=>2
,p_render_function=>'render'
,p_ajax_function=>'ajax'
,p_standard_attributes=>'WAIT_FOR_RESULT'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>'The plugin allows you to take the screenshot of the component in APEX app.'
,p_version_identifier=>'1.0'
,p_about_url=>'https://github.com/RittmanMead/rm-component-capture'
,p_files_version=>439
);
